using Microsoft.EntityFrameworkCore;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace Ident.Models
{
    public class PictureDbContext: DbContext
    {
        public DbSet<Picture>Pictures{ get; set;}

    public
    PictureDbContext(DbContextOptions<PictureDbContext>options):
    base(options)
        {
            LoadDefaultPictures();
        }
        public List<Picture> getUsers() => Pictures.Local.ToList<Picture>();

        private void LoadDefaultPictures()
        {
            Pictures.Add(new Picture { IdentityID = 100, birthdate = new DateTime(98,05,25), Name= "Raul Sanchez",Photo= "data:image/jpeg;base64,",Sex="Masculino",email="rauls@gmail.com"});
            Pictures.Add(new Picture { IdentityID = 200, birthdate = DateTime.Now, Name= "Lucy Cespedes",Photo="",Sex="Femenino",email="Lucyc@gmail.com" });
        }
    }
}
